import React from 'react';

const Navbar = () => {
    return (
        <div>
          <header id="header">
  <div className="inner">
    <a href="index.html" className="logo">
      <img src="images\CTVLogoCleanCopy.png" style={{width: 'auto', height: 50, display: 'block', marginLeft: 'auto', marginRight: 'auto'}} alt="Home" />
    </a>
    <nav id="nav">
      <a href="index.html">Home</a>
      {/* <a href="elements.html">Testimonials</a> */}
      <a href="https://www.worldometers.info/coronavirus/country/india/" target="_blank">Covid Stats</a>
      <a href="AboutUs.html">About Us</a>
      <a href="login_reg.html">Log In / Register</a>
    </nav>
    <a href="#navPanel" className="navPanelToggle"><span className="fa fa-bars" /></a>
  </div>
</header>
       </div>
    );
};

export default Navbar;
